import React from 'react';
import './App.css';
import Classification from './Classification';
import Navigation from './Navigation'

function App() {
  return (
    <div className="App">
      <Classification />
      <Navigation />
      <header className="App-header">
        Welcome, galvanize to your React app for sdi05-05!
      </header>
    </div>
  );
}

export default App;
